<!DOCTYPE html>
<html>
      
<head>
    <title>
        Search
    </title>
      
    <!-- linking the stylesheet(CSS) -->
    <style type="text/css">

		.searchbar{
			margin-left: 15px;
			padding:15px;
			border-radius: 10px;
			font-size: 1.5em;
		}
	 
		input[type=text] { width: 30%; }
		input[type=number] { width: 10%; }

		.name { display: list-item; } 


		body {
			color: #333;
			font-family: -apple-system, BlinkMacSystemFont, "Segoe UI", Roboto, Oxygen-Sans, Ubuntu, Cantarell, "Helvetica Neue", sans-serif;
		}
		h1 {
			font-weight: 700;
			font-size: 6.5vmin;
			letter-spacing: 0.1rem;
			text-transform: uppercase;
			text-align: center;
		}
	</style>
</head>
  
<body>
     
    <h1>Gordle How? Hack Trick!</h1>

    <!-- input tag -->
    <input id="search-in" class="searchbar" onkeyup="search_all()" type="text"
        name="search-in" placeholder="Include..."
        autocomplete="off" autocorrect="off" autocapitalize="off" spellcheck="false">
    <input id="search-ex" class="searchbar" onkeyup="search_all()" type="text"
        name="search-ex" placeholder="Exclude..."
        autocomplete="off" autocorrect="off" autocapitalize="off" spellcheck="false">
    <input id="search-num" class="searchbar" onkeyup="search_all()" onmouseup="search_all()" type="number"
        name="search-num" placeholder="Length"
        autocomplete="off" autocorrect="off" autocapitalize="off" spellcheck="false">
      
    <!-- ordered list -->
    <ol id='list'>

    </ol>

    <p id="test" style="display: block; width:100%;"></p>
      
    <!-- linking javascript -->
    <script>
		function display_names(a) {
			const ol = document.getElementById("list");
			ol.innerHTML = "";

			if (a.length < 100 && a.length > 0) {
				for (let i = 0; i < a.length; i++) {
					ol.innerHTML += ("<li class='name'>" + a[i] + "</li>");
				}
			}
			else {
				ol.innerHTML += ("<strong>" + a.length + " results...</strong>");
			}
            document.getElementById("test").innerHTML = a;
		}

		function search_all() {
			let include = document.getElementById('search-in').value;
			let exclude = document.getElementById('search-ex').value;
			let number = document.getElementById('search-num').value;

			// array NAMELIST only with correct length
			let namelist = names.filter(function(value, index, arr) { 
				return value.length == number || number < 1;
			});

			// remove items with letters from EXCLUDE string
			for (let j = 0; j < exclude.length; j++) {
				for (let i = namelist.length - 1; i >= 0; i--) {
					if (namelist[i].toLowerCase().indexOf(exclude[j]) > -1) {
						namelist.splice(i, 1);
					}
				}
			}

			// remove items without letters from INCLUDE string
			for (let j = 0; j < include.length; j++) {
				for (let i = namelist.length - 1; i >= 0; i--) {
					if (namelist[i].toLowerCase().indexOf(include[j].toLowerCase()) == -1) {
						namelist.splice(i, 1);
					}
				}
			}

			display_names(namelist.sort());
		}

		// parse names into array
		function create_array(a) {
			// remove whitespaces
			let b = a.replace(/\s/g, '');
			// split
			let c = b.split(":!0,");
			// remove empties
			d = c.filter(item => item);
			// remove duplicates
			names = d.filter((item, index) => {
			    return d.indexOf(item) === index;
			});
